INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 787, 37, 2, "2021/10/19 12:00:00", 118501, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 37, 118501, 0, "カリン", 118501, "2030/12/31 15:00:00", "かりん", 0, 1, 0, 118501, 1, 450, 0, 0, 2.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 826, 0, 2, "2024/08/10 21:00:00", 118601, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 118601, 0, "ネビア", 118601, "2030/12/31 15:00:00", "ねびあ", 0, 3, 0, 118601, 1, 450, 0, 0, 2.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 714, 7, 2, "2021/11/03 19:00:00", 119001, 15, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 7, 119001, 0, "イオ（ノワール）", 119001, "2030/12/31 15:00:00", "いお", 0, 3, 0, 119001, 0, 450, 0, 0, 2.27);
