INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 164, 5, 1, "2024/02/22 12:00:00", 121001, 1, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 41, 121001, 0, "ペコリーヌ（オーバーロード）", 121001, "2024/02/29 11:59:59", "ぺこりーぬ", 0, 3, 0, 121001, 1, 450, 0, 0, 2.25);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 588, 7, 2, "2024/02/22 12:00:00", 121101, 1, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 42, 121101, 0, "キャル（オーバーロード）", 121101, "2024/02/29 11:59:59", "きゃる", 0, 3, 0, 121101, 1, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 260, 4, 1, "2023/11/16 15:00:00", 121201, 6, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 40, 121201, 0, "ラビリスタ（オーバーロード）", 121201, "2030/12/31 15:00:00", "らびりすた", 0, 1, 0, 121201, 1, 450, 0, 0, 1.55);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 731, 3, 1, "2022/03/03 19:00:00", 121301, 3, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 121301, 0, "クルミ（ステージ）", 121301, "2030/12/31 15:00:00", "くるみ", 0, 3, 0, 121301, 0, 450, 0, 0, 1.9);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 742, 7, 2, "2022/03/15 15:00:00", 121401, 15, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 121401, 0, "ミサキ（ステージ）", 121401, "2030/12/31 15:00:00", "みさき", 0, 3, 0, 121401, 0, 450, 0, 0, 2.27);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 590, 6, 1, "2024/04/12 12:00:00", 121501, 12, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 121501, 0, "アユミ（怪盗）", 121501, "2024/04/15 14:59:59", "あゆみ", 0, 3, 0, 121501, 1, 450, 0, 0, 2.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 292, 3, 1, "2022/04/15 15:00:00", 121601, 17, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 3, 121601, 0, "イノリ（怪盗）", 121601, "2030/12/31 15:00:00", "いのり", 0, 3, 0, 121601, 0, 450, 0, 0, 1.425);
