INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 380, 3, 1, "2022/05/03 19:00:00", 122001, 14, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 122001, 0, "シノブ（パイレーツ）", 122001, "2030/12/31 15:00:00", "しのぶ", 0, 3, 0, 122001, 0, 450, 0, 0, 1.425);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 731, 35, 1, "2024/04/18 15:00:00", 122101, 9, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 122101, 0, "アオイ（キャンプ）", 122101, "2030/12/31 15:00:00", "あおい", 0, 1, 0, 122101, 1, 450, 0, 0, 1.97);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 419, 4, 1, "2022/05/31 12:00:00", 122201, 8, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 4, 122201, 0, "ユカリ（キャンプ）", 122201, "2030/12/31 15:00:00", "ゆかり", 0, 3, 0, 122201, 0, 450, 0, 0, 1.84);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 564, 43, 2, "2022/06/15 15:00:00", 122301, 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 122301, 0, "ヴァンピィ", 122301, "2030/12/31 15:00:00", "うぁんぴぃ", 0, 3, 0, 122301, 0, 450, 0, 0, 1.425);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 264, 1, 1, "2024/06/17 15:00:00", 122401, 8, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 122401, 0, "ヒヨリ（サマー）", 122401, "2030/12/31 15:00:00", "ひより", 0, 1, 0, 122401, 1, 450, 0, 0, 2.42);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 250, 4, 1, "2024/08/26 19:00:00", 122501, 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 4, 122501, 0, "レイ（サマー）", 122501, "2024/08/31 11:59:59", "れい", 0, 3, 0, 122501, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 554, 7, 2, "2022/07/15 15:00:00", 122601, 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 7, 122601, 0, "ユイ（サマー）", 122601, "2030/12/31 15:00:00", "ゆい", 0, 3, 0, 122601, 0, 450, 0, 0, 2.27);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 812, 7, 2, "2022/08/15 15:00:00", 122701, 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 122701, 0, "キョウカ（サマー）", 122701, "2030/12/31 15:00:00", "きょうか", 0, 3, 0, 122701, 0, 450, 0, 0, 1.92);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 237, 1, 1, "2024/07/16 15:00:00", 122801, 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 122801, 0, "ミソギ（サマー）", 122801, "2030/12/31 15:00:00", "みそぎ", 0, 1, 0, 122801, 1, 450, 0, 0, 2.295);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 361, 5, 1, "2024/08/26 19:00:00", 122901, 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 122901, 0, "ミミ（サマー）", 122901, "2024/08/31 11:59:59", "みみ", 0, 3, 0, 122901, 1, 450, 0, 0, 2.25);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 746, 44, 2, "2024/08/23 12:00:00", 123001, 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 44, 123001, 0, "アメス", 123001, "2024/08/26 18:59:59", "あめす", 0, 3, 0, 123001, 1, 450, 0, 0, 2.27);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 793, 7, 2, "2022/09/03 19:00:00", 123101, 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 123101, 0, "マホ（エクスプローラー）", 123101, "2030/12/31 15:00:00", "まほ", 0, 3, 0, 123101, 0, 450, 0, 0, 1.795);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 256, 3, 1, "2022/09/15 15:00:00", 123201, 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 123201, 0, "アヤネ（エクスプローラー）", 123201, "2030/12/31 15:00:00", "あやね", 0, 3, 0, 123201, 0, 450, 0, 0, 1.425);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 350, 1, 1, "2024/09/25 12:00:00", 123301, 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 0, 123301, 0, "ネア", 123301, "2024/09/30 11:59:59", "ねあ", 0, 3, 0, 123301, 1, 450, 0, 0, 1.62);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 0, 5, 0, "2015/04/01 15:00:00", 123401, 0, "", 5, 0, 0, "ジュン（キャンプ）", 0, "2030/12/31 15:00:00", "じゅん", 0, 3, 0, 123401, 0, 0, 0, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 583, 6, 1, "2024/09/17 15:00:00", 123501, 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 6, 123501, 0, "リン（ハロウィン）", 123501, "2030/12/31 15:00:00", "りん", 0, 1, 0, 123501, 1, 450, 0, 0, 2.34);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 262, 4, 1, "2023/10/10 12:00:00", 123601, 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 4, 123601, 0, "トモ（ハロウィン）", 123601, "2023/10/15 14:59:59", "とも", 0, 3, 0, 123601, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 741, 7, 2, "2022/10/15 15:00:00", 123701, 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 21, 123701, 0, "ナナカ（ハロウィン）", 123701, "2030/12/31 15:00:00", "ななか", 0, 3, 0, 123701, 0, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 238, 1, 1, "2023/11/10 12:00:00", 123801, 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 123801, 0, "クリスティーナ（ワイルド）", 123801, "2023/11/15 14:59:59", "くりすてぃーな", 0, 3, 0, 123801, 1, 450, 0, 0, 2.295);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 183, 2, 1, "2022/11/15 15:00:00", 123901, 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 2, 123901, 0, "マツリ（ワイルド）", 123901, "2030/12/31 15:00:00", "まつり", 0, 3, 0, 123901, 0, 450, 0, 0, 2.125);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 438, 7, 2, "2023/12/11 12:00:00", 124001, 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 7, 124001, 0, "アカリ（クリスマス）", 124001, "2023/12/15 14:59:59", "あかり", 0, 3, 0, 124001, 1, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 433, 6, 2, "2022/11/30 12:00:00", 124101, 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 6, 124101, 0, "ヨリ（クリスマス）", 124101, "2030/12/31 15:00:00", "より", 0, 1, 0, 124101, 1, 450, 1, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 144, 5, 1, "2022/12/23 12:00:00", 124201, 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 5, 124201, 0, "ジュン（クリスマス）", 124201, "2030/12/31 15:00:00", "じゅん", 0, 3, 0, 124201, 0, 450, 0, 0, 2.07);
