INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 707, 7, 2, "2024/01/12 12:00:00", 124501, 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 21, 124501, 0, "ホマレ（ニューイヤー）", 124501, "2024/01/15 14:59:59", "ほまれ", 0, 3, 0, 124501, 1, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 698, 7, 2, "2024/01/12 12:00:00", 124601, 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 21, 124601, 0, "ミサト（ニューイヤー）", 124601, "2024/01/15 14:59:59", "みさと", 0, 3, 0, 124601, 1, 450, 0, 0, 2.44);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 590, 7, 1, "2022/12/31 12:00:00", 124701, 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 46, 124701, 0, "ミツキ（ニューイヤー）", 124701, "2030/12/31 15:00:00", "みつき", 0, 1, 0, 124701, 1, 450, 1, 0, 2.24);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 423, 4, 1, "2024/02/12 12:00:00", 124801, 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 0, 124801, 0, "ノゾミ（リベレイター）", 124801, "2024/02/14 23:59:59", "のぞみ", 0, 3, 0, 124801, 1, 450, 0, 0, 2.14);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 170, 1, 1, "2023/01/31 12:00:00", 124901, 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 0, 124901, 0, "カヤ（リベレイター）", 124901, "2030/12/31 15:00:00", "かや", 0, 1, 0, 124901, 1, 450, 1, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 221, 5, 1, "2024/02/12 12:00:00", 125001, 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 0, 125001, 0, "ムイミ（リベレイター）", 125001, "2024/02/14 23:59:59", "むいみ", 0, 3, 0, 125001, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 825, 8, 1, "2023/03/03 19:00:00", 125101, 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 47, 125101, 0, "タマキ（カフェ）", 125101, "2030/12/31 15:00:00", "たまき", 0, 3, 0, 125101, 0, 450, 0, 0, 2.24);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 463, 4, 1, "2023/03/10 12:00:00", 125201, 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 125201, 0, "モニカ（カフェ）", 125201, "2030/12/31 15:00:00", "もにか", 0, 3, 0, 125201, 0, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 752, 6, 1, "2024/04/12 12:00:00", 125301, 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 125301, 0, "コッコロ（レンジャー）", 125301, "2024/04/15 14:59:59", "こっころ", 0, 3, 0, 125301, 1, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 710, 8, 1, "2023/04/10 12:00:00", 125401, 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 125401, 0, "シオリ（レンジャー）", 125401, "2030/12/31 15:00:00", "しおり", 0, 3, 0, 125401, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 443, 7, 2, "2024/05/10 12:00:00", 125501, 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 50, 125501, 0, "ジータ（ウォーロック）", 125501, "2024/05/15 14:59:59", "じーた", 0, 3, 0, 125501, 1, 450, 0, 0, 1.92);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 267, 51, 1, "2024/05/10 12:00:00", 125601, 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 0, 125601, 0, "ビカラ", 125601, "2024/05/15 14:59:59", "びから", 0, 3, 0, 125601, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 579, 7, 2, "2023/04/30 12:00:00", 125701, 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 9, 125701, 0, "カリン（アルケミスト）", 125701, "2030/12/31 15:00:00", "かりん", 0, 1, 0, 125701, 1, 450, 1, 0, 2.24);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 464, 3, 1, "2023/04/17 12:00:00", 125801, 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 125801, 0, "リリ（フォールン）", 125801, "2030/12/31 15:00:00", "りり", 0, 3, 0, 125801, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 0, 1, 0, "2015/04/01 15:00:00", 125901, 0, "", 1, 0, 0, "カヤ（リベレイター）", 0, "2030/12/31 15:00:00", "かや", 0, 3, 0, 125901, 1, 0, 0, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 406, 0, 1, "2023/10/31 12:00:00", 126001, 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 126001, 0, "クリア（フォールン）", 126001, "2030/12/31 15:00:00", "くりあ", 0, 3, 0, 126001, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 480, 44, 2, "2023/11/15 15:00:00", 126101, 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 53, 126101, 0, "プレシア（フォールン）", 126101, "2030/12/31 15:00:00", "ぷれしあ", 0, 3, 0, 126101, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 568, 3, 2, "2024/06/10 12:00:00", 126201, 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 126201, 0, "イリヤ（儀装束）", 126201, "2024/06/15 14:59:59", "いりや", 0, 3, 0, 126201, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 456, 7, 2, "2023/06/15 15:00:00", 126301, 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 9, 126301, 0, "ユキ（儀装束）", 126301, "2030/12/31 15:00:00", "ゆき", 0, 3, 0, 126301, 0, 450, 0, 0, 2.07);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 373, 1, 1, "2024/08/23 12:00:00", 126401, 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 126401, 0, "クローチェ", 126401, "2024/08/26 18:59:59", "くろーちぇ", 0, 3, 0, 126401, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 740, 7, 2, "2024/08/23 12:00:00", 126501, 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 0, 126501, 0, "ライラエル", 126501, "2024/08/26 18:59:59", "らいらえる", 0, 3, 0, 126501, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 650, 7, 2, "2024/07/11 12:00:00", 126601, 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 126601, 0, "ネネカ（サマー）", 126601, "2024/07/15 14:59:59", "ねねか", 0, 3, 0, 126601, 1, 450, 0, 0, 2.04);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 224, 5, 1, "2023/06/30 12:00:00", 126701, 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 126701, 0, "アキノ（サマー）", 126701, "2030/12/31 15:00:00", "あきの", 0, 1, 0, 126701, 1, 450, 1, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 159, 5, 1, "2023/07/15 15:00:00", 126801, 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 126801, 0, "ユカリ（サマー）", 126801, "2030/12/31 15:00:00", "ゆかり", 0, 3, 0, 126801, 0, 450, 0, 0, 1.97);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 682, 7, 2, "2024/08/09 12:00:00", 126901, 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 21, 126901, 0, "ランファ（サマー）", 126901, "2024/08/12 11:59:59", "らんふぁ", 0, 3, 0, 126901, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 133, 2, 1, "2023/07/31 12:00:00", 127001, 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 52, 127001, 0, "クウカ（サマー）", 127001, "2023/08/14 20:59:59", "くうか", 0, 1, 0, 127001, 1, 450, 1, 0, 1.97);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 255, 5, 1, "2024/08/09 12:00:00", 127101, 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 46, 127101, 0, "シノブ（サマー）", 127101, "2024/08/12 11:59:59", "しのぶ", 0, 3, 0, 127101, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 804, 7, 2, "2024/10/10 12:00:00", 127201, 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 127201, 0, "キャル（編入生）", 127201, "2024/10/13 11:59:59", "きゃる", 0, 3, 0, 127201, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 750, 8, 1, "2023/09/15 15:00:00", 127301, 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 127301, 0, "スズナ（編入生）", 127301, "2030/12/31 15:00:00", "すずな", 0, 3, 0, 127301, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 0, 1, 0, "2015/04/01 15:00:00", 127401, 0, "", 1, 0, 0, "ビカラ（コラボ）", 0, "2030/12/31 15:00:00", "びから", 0, 3, 0, 127401, 1, 0, 0, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 304, 4, 1, "2024/04/26 12:00:00", 127501, 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 127501, 0, "サレン（サラサリア）", 127501, "2024/04/30 11:59:59", "されん", 0, 3, 0, 127501, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 157, 4, 1, "2023/10/15 15:00:00", 127601, 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 127601, 0, "ルカ（サラサリア）", 127601, "2030/12/31 15:00:00", "るか", 0, 3, 0, 127601, 0, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 693, 6, 2, "2024/10/10 12:00:00", 127701, 0, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 48, 127701, 0, "リンド", 127701, "2030/12/31 15:00:00", "りんど", 0, 3, 0, 127701, 0, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 372, 5, 2, "2024/05/27 12:00:00", 127901, 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 127901, 0, "ペコリーヌ（クリスマス）", 127901, "2024/05/31 11:59:59", "ぺこりーぬ", 0, 3, 0, 127901, 1, 450, 0, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 723, 35, 1, "2023/12/15 15:00:00", 128001, 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 35, 128001, 0, "クレジッタ（クリスマス）", 128001, "2030/12/31 15:00:00", "くれじった", 0, 3, 0, 128001, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 580, 0, 0, "2015/04/01 15:00:00", 128101, 0, "", 0, 0, 0, "シズル（シズル&リノ）", 0, "2030/12/31 15:00:00", "しずる", 181101, 3, 0, 128101, 1, 0, 1, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 580, 0, 0, "2015/04/01 15:00:00", 128201, 0, "", 0, 0, 0, "リノ（シズル&リノ）", 0, "2030/12/31 15:00:00", "りの", 181101, 3, 0, 128201, 1, 0, 1, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 191, 3, 1, "2023/12/31 12:00:00", 128301, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 38, 128301, 0, "イノリ（ニューイヤー）", 128301, "2030/12/31 15:00:00", "いのり", 0, 1, 0, 128301, 1, 450, 1, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 801, 7, 2, "2024/06/26 12:00:00", 128401, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 21, 128401, 0, "ハツネ（ニューイヤー）", 128401, "2024/06/30 11:59:59", "はつね", 0, 3, 0, 128401, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 739, 7, 2, "2024/06/26 12:00:00", 128501, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 21, 128501, 0, "カスミ（ニューイヤー）", 128501, "2024/06/30 11:59:59", "かすみ", 0, 3, 0, 128501, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 0, 1, 0, "2015/04/01 15:00:00", 128601, 0, "", 1, 0, 0, "リリ（フォールン）", 0, "2030/12/31 15:00:00", "りり", 0, 3, 0, 128601, 1, 0, 0, 0, 0.0);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 226, 1, 1, "2024/08/12 12:00:00", 128701, 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 128701, 0, "ヒヨリ（アストラル）", 128701, "2024/08/15 14:59:59", "ひより", 0, 3, 0, 128701, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 194, 4, 1, "2024/01/31 12:00:00", 128801, 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 128801, 0, "レイ（アストラル）", 128801, "2030/12/31 15:00:00", "れい", 0, 1, 0, 128801, 1, 450, 1, 0, 1.965);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 772, 7, 2, "2024/08/12 12:00:00", 128901, 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 128901, 0, "ユイ（アストラル）", 128901, "2024/08/15 14:59:59", "ゆい", 0, 3, 0, 128901, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 800, 7, 2, "2024/08/23 12:00:00", 129001, 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 129001, 0, "エリス", 129001, "2024/08/26 18:59:59", "えりす", 0, 3, 0, 129001, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 708, 7, 1, "2024/09/25 12:00:00", 129301, 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 7, 129301, 0, "ユニ（ウィンター）", 129301, "2024/09/30 11:59:59", "ゆに", 0, 3, 0, 129301, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 188, 2, 1, "2024/03/18 12:00:00", 129401, 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 2, 129401, 0, "クロエ（ウィンター）", 129401, "2030/12/31 15:00:00", "くろえ", 0, 3, 0, 129401, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 550, 0, 1, "2024/08/23 12:00:00", 129601, 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 129601, 0, "アネモネ", 129601, "2024/08/26 18:59:59", "あねもね", 0, 3, 0, 129601, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 540, 0, 1, "2024/08/23 12:00:00", 129701, 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 129701, 0, "ネフィ＝ネラ", 129701, "2024/08/26 18:59:59", "ねふぃーねら", 0, 3, 0, 129701, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 269, 5, 1, "2024/10/13 12:00:00", 129801, 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 5, 129801, 0, "マコト（コマンダー）", 129801, "2024/10/18 11:59:59", "まこと", 0, 3, 0, 129801, 1, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 294, 6, 1, "2024/04/15 15:00:00", 129901, 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 48, 129901, 0, "エリコ（コマンダー）", 129901, "2030/12/31 15:00:00", "えりこ", 0, 3, 0, 129901, 0, 450, 0, 0, 1.84);
