INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 558, 7, 2, "2024/05/15 15:00:00", 130801, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 7, 130801, 0, "スズメ（スプリング）", 130801, "2030/12/31 15:00:00", "すずめ", 0, 3, 0, 130801, 0, 450, 0, 0, 1.84);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 440, 7, 2, "2024/06/15 15:00:00", 130901, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 7, 130901, 0, "クルル", 130901, "2030/12/31 15:00:00", "くるる", 0, 3, 0, 130901, 0, 450, 0, 0, 2.09);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 702, 7, 2, "2024/05/31 12:00:00", 131001, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 7, 131001, 0, "マホ（ドリームパーク）", 131001, "2024/06/10 11:59:59", "まほ", 0, 3, 0, 131001, 1, 450, 0, 0, 1.84);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 165, 2, 1, "2024/06/30 12:00:00", 131101, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 52, 131101, 0, "ネア（サマー）", 131101, "2030/12/31 15:00:00", "ねあ", 0, 3, 0, 131101, 0, 450, 0, 0, 2.09);
